import React from "react";

export default function Dashboard() {
  return (
    <div style={{ padding: "2rem" }}>
      <h1>Bienvenido al Dashboard</h1>
      <p>Desde aquí podrás ver tu calendario, reportes y gestionar citas.</p>
    </div>
  );
}
